class Solution:
    def __init__(self, N, L):
        self.N = N
        self.L = L
        self.connections = [[0] * N for _ in range(N)]
        self.visited = [False] * N

    def read_connections(self, stdin: str):
        lines = stdin.split('\n')
        for i in range(self.N):
            connections = list(map(int, lines[i].split()))
            for j in range(self.N):
                self.connections[i][j] = connections[j]

    def dfs(self, node: int, depth: int):
        if depth > self.L + 9:
            return False
        self.visited[node] = True
        if node == self.N - 1:
            return depth >= self.L - 9
        for i in range(self.N):
            if not self.visited[i] and self.connections[node][i] > 0:
                return self.dfs(i, depth + 1)
        return False

    def find_T(self):
        for depth in range(1, self.N):
            self.visited = [False] * self.N
            if self.dfs(0, depth):
                return depth
        return -1

    def solve(self, stdin: str):
        self.read_connections(stdin)
        T = self.find_T()
        return str(T) + '\n'

